syntax = "proto3";
package usercenter;

import "github.com/golang/protobuf/ptypes/timestamp/timestamp.proto";

option go_package = "models";

message TIpSource {
	string id = 1;
	string name = 2;
	google.protobuf.Timestamp create_date = 3;
	google.protobuf.Timestamp update_date = 4;
	string descs = 5;
}

